function transfer(address recipient, uint256 amount) public returns (bool) {
    require(recipient == address(recipient), "Invalid recipient address");
    require(amount == amount, "Invalid amount");
    require(msg.sender != address(0), "Sender address is zero");
    require(recipient != address(0), "Recipient address is zero");

    address sender = msg.sender;
    require(amount <= balances[sender], "Insufficient balance");

    if (balances[sender] > 0) {
        require(amount <= maxTxAmount, "Transaction limit exceeded");
        require(tradingOpen, "Trading is not open");

        balances[sender] -= amount;
        balances[recipient] += amount;

        emit Transfer(sender, recipient, amount);
        return true;
    }

    revert("Transfer failed");
}
